      "id": "697296f2-ba7f-4f1e-9275-d275afe28601",
      "time": "2020-05-19 07:15:58",
      "title": "The Way He Looks",
      "body": "Traveling became almost extinct during the pandemic."
    },]

    const data = {

         notes: [],
         searchValue: '',
         filteredNotes: [],

    }


  return (
    <MyContext.Provider value={{data}} >
        {children}
    </MyContext.Provider>
  )
}

export default MyProvider
